function App() {

  const handleOnSearchChnage = (searchData) => {  
    console.log(searchData);
  };

  return (
    <div className="container">
       <p className="title">Weather Application </p>
      <Search onSearchChange={handleOnSearchChnage}/>
      <CurrentWeather/>
    </div>
  );
}

export default App;
